) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;


DROP TABLE IF EXISTS `series_reviews`;
CREATE TABLE `series_reviews` (
  `username` varchar(255) NOT NULL,
  `rating` float NOT NULL,
